import React from "react";
import {
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  Dot,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";
import "./SlickCard.css";
import { baseUrlForImg } from "../baseUrl/baseUrl";

const SlickCard = ({ images }) => {
  console.log(images);
  return (
    <CarouselProvider
      naturalSlideWidth={150}
      naturalSlideHeight={150}
      totalSlides={3}
      className="row"
    >
      <Slider>
        {images &&
          images.map((img, index) => (
            <Slide index={index} key={index}>
              <div className="image-box">
                <ImageWithZoom
                  className="image-box-img"
                  src={baseUrlForImg + img.path}
                />
              </div>
            </Slide>
          ))}
      </Slider>
      <div className="dots col s2 fullWidth">
        {images &&
          images.map((img, index) => (
            <Dot slide={index} key={index} className="slider-dot">
              <img src={baseUrlForImg + img.path} />
            </Dot>
          ))}

        <Dot slide={0} className="slider-dot">
          <img
            src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            alt=""
          />
        </Dot>
        <Dot slide={1} className="slider-dot">
          <img
            src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            alt=""
          />
        </Dot>
        <Dot slide={2} className="slider-dot">
          <img
            src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            alt=""
          />
        </Dot>

        <Dot slide={2} className="slider-dot">
          <img
            src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            alt=""
          />
        </Dot>

        <Dot slide={2} className="slider-dot">
          <img
            src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            alt=""
          />
        </Dot>
      </div>
    </CarouselProvider>
  );
};

export default SlickCard;
